import Vue from 'vue'
import Router from 'vue-router'
import About from '../views/About/index'
import Home from '../views/home/index'

Vue.useAttrs(Router)
export default new Router({
    routes:[
        {
            path:'/',
            name:'Home',
            component:Home
        },
        {
            path:'/about',
            name:'About',
            component:About
        }
    ]
})
